import React, { Component } from 'react'
import '.\style.css'

class toDoItem extends Component {
    constructor(props){
        super(props)
    }

    render() {
        return (
            <div>
                <li>{this.props.name}</li>
            </div>
        )
    }
}
export default toDoItem;
